import React from "react";
import classes from "./CompanyList.module.css";

const CompanyList = () => {
  return (
    <React.Fragment>
      <div className={classes.row}>
        <span className={classes.column}>
          <img src="https://logo.clearbit.com/icicibank.com?size=80&grayscale=true" />
          <h2>Management Trainee</h2>
          <h3>
            <a href="https://www.icicibank.com/">ICICI Bank</a>
          </h3>
          <p>
            I am working here as a Management Trainee. Project work is to push
            all on-prem databases like iMobile, UPI, PCMS, iCore and Prime on
            Azure cloud to make data analytics and business more efficient. And
            for this data extraction is happening through Golden Gate(GG) b/w
            source and destination.
          </p>
        </span>
      </div>
    </React.Fragment>
  );
};

export default CompanyList;
